    - content: >-
        Angle Atmos Briefing:

        No O2 Miner, however the O2 chamber contains a large quantity of O2 in it.

        There is a gas recycler portion denoted by the green pipes. There is a CO2 miner that can be converted into O2.

        There are two general-purpose storage chambers to the southeast that can be used for any gas, set them up if desired.


        There is a "nitrogen panic valve" by the blue network. Please only use it if you need to rapidly repressurize the station in the absence of oxygen. Consider calling yellow alert in the event it is opened any longer than a minute.
